#include "source.c"
#include <stdio.h>

void readData(int array[]) {
	int i;
	for (i = 0; i < 10; ++ i) {
		scanf("%d", &array[i]);
	}
}

void print(int array[]) {
	int i;
	for (i = 0; i < 10; ++ i) {
		printf("%d ", array[i]);
	}
}

int main() {
	int data[10];
	readData(data);
	insertionSort(data, 10);
	print(data);
}

void insertionSort(int data[],int num){
	int temp;
	for (int i = 0; i < num; ++ i){
		for (int j = 0; j < num; ++ j){
			if(data[i]<data[j]){
				temp=data[i];
				data[i]=data[j];
				data[j]=temp;
			}
		} 
	}
}
